import React from 'react';
import Head from 'next/head';
import Menu from '../componete/Menu.js';
import RodaPe from '../componete/RodaPe';

import { Jumbotron, Container } from 'reactstrap';

function contato() {
    return (<div>
        <Head>
            <title>Contato</title>
            <meta name='robots' content='index, follow' />
            <meta name="description" content="Entre em contato com a Segunda Igreja Batista no Recanto das Emas-DF"></meta>
            <meta name="author" content="Ernilson Daniel Lima de Souza" />
        </Head>
        <Menu />
        <Jumbotron fluid className="head-contato">
            <style>{`.head-contato{
                padding-top: 80px;
                padding-buttom:20px;
                background-color: #fff;
                margin-bottom: 0ren ! important;
         }`}</style>
            <Container>
                <h1 className="display-4 text-center">Contato</h1>
            </Container>
        </Jumbotron>

        <Jumbotron fluid className="form-contato">
        <style>{`.head-contato{
                padding-top: 80px;
                padding-buttom:80px;
                background-color: #fff;
                margin-bottom: 0ren ! important;
         }`}</style>
            <Container>
                <div class="row featurette">
                    <div className="col-md-6">

                    </div>
                    <div className="col-md-6">
                        <h2 className="featurette-heading">First featurette heading. <span className="text-muted">
                            It’ll blow your mind.</span></h2>
                        <p className="lead">Donec ullamcorper nulla non metus auctor fringilla. Vestibulum id ligula
                        porta felis euismod semper.
                        Praesent commodo cursus magna, vel scelerisque nisl consectetur. Fusce dapibus, tellus ac
                          cursus commodo.</p>
                    </div>

                </div>
            </Container>
        </Jumbotron>
         <RodaPe />
    </div>)
}

export default contato;
